import React from 'react';
import Button from '@material-ui/core/Button';
import '../App.css';


function Entry(props) {
  return (
    <p>
      <Button variant='outlined' href={props.href}>
        {props.children}
      </Button>
    </p>

  );
}


function Page() {
    return (
      <>
        <p>
          <img src='./normalizing-flows.png' style={{ borderRadius: '10px', width: '100%' }} />
        </p>
        <p>
          <img src='./hoover.gif' style={{ borderRadius: '10px', width: '100%' }} />
        </p>
      </>
    );
}

export default Page;
